import React from 'react';
import styled from 'styled-components';
import Ingredient from './Ingredient';

const Ingredients = styled.div`
    border-bottom: 1px solid #2E3E55;
    border-left: 1px solid #2E3E55;
    border-right: 1px solid #2E3E55;
`;

export default function RecipeIngredients(props) {
  const { ingredients } = props;

  const ingredientList = ingredients.map(ingredient => <Ingredient ingredient={ingredient} />);

  return (
    <Ingredients>
      {ingredientList}
    </Ingredients>
  );
}
